import React from 'react'
import Card from './Components/Card'
import Data from './Data'

function App(){
   // let items=[];
   // items=Data.map((val,index) => <Card image={val.image} title={val.title} />)
    return <div>
        <h1 className="headingStyle">List of Top 5 series</h1>
        <Card
        imgsrc={Data[0].imgscr}
        title={Data[0].title}
        sname={Data[0].sname}
        />
    </div>
}
export default App;
